import React, { Component } from 'react'

export default class classState extends Component {
    constructor(){
        super();
        this.state={
            count: 0
        }
    }
    incrementCount(){
        this.setState({count : this.state.count +1})
    }
    render() {
        return (
            <div>
                <button onClick={this.incrementCount}>click {this.state.count} times</button>
            </div>
        )
    }
}
